    $(function () {
        $('#tree').jstree({

            ""core"": {
                ""themes"": {
                    ""icons"": false
                }
            },
            ""plugins"": [""wholerow"", ""checkbox""]
        });
    });

    function submitForm() {
        var checked_ids = [];
        var selectedElms = $('#tree').jstree(""get_selected"", true);
        $.each(selectedElms, function () {
            if (this.id.indexOf(""node"") == -1)
                checked_ids.push(this.id);
        });
        $('#ActionIds').val(checked_ids.join("",""));
        $( ""form"" ).submit();
    }
</script>
